import React from "react";

export default function Nav() {
  return (
    <div>
      <li>
        <div to="/newest">신상품</div>
      </li>
      <li>
        <span>베스트</span>
      </li>
      <li>
        <span>알뜰쇼핑</span>
      </li>
      <li>
        <span>특가/혜택</span>
      </li>
    </div>
  );
}
